const { createSlice } = require('@reduxjs/toolkit');

export const clicksSlice = createSlice({
  name: 'clicks',
  initialState:{value: 0}, 
  reducers:{
    update:  (state, action) => {
        state.value +=1
    },

  }
});
export const {update} = clicksSlice.actions

// export default clicksSlice.reducer
